			logout(){
				var _this  = this
				uni.showLoading({
					title: '退出中...'
				});
				removeAll()
				setTimeout(function(){
					uni.hideLoading();
					_this.onLoadPage()
				},2000)
			},
			onChooseAvatar(e){
				uni.showLoading({
					title: '图片上传中...'
				});
				upLoadImg(e.detail.avatarUrl).then(res=>{
					this.userInfo.avatarUrl = res.data
					updateUser(this.userInfo)
					.then(res=>{
						setUser(this.userInfo)
						uni.hideLoading();
					})
					.catch(error=>{
						uni.hideLoading();
						uni.showToast({
							title: '头像上传失败!',
							icon: 'error',
							duration: 2000
						});
					})
				}).catch(error=>{
					uni.hideLoading();
					uni.showToast({
						title: '头像上传失败!',
						icon: 'error',
						duration: 2000
					});
				})
			},
			toVip() {
				uni.navigateTo({
					url: '../vip/vip'
				})
			},
			onLoadPage(){
				const pages = getCurrentPages()
				// 声明一个pages使用getCurrentPages方法
				const curPage = pages[pages.length - 1]
				// 声明一个当前页面
				curPage.onLoad(curPage.options) // 传入参数
				curPage.onShow()
				curPage.onReady()
			},
			wxLogin() {
				uni.showLoading({
					title: '登录中...'
				});
				this.isLogin = true
				this.userInfo = this.getUserInfo()
				uni.hideLoading();
				
				this.onLoadPage()
			}
			,
			getUserInfo(){
